import "./MoviesCard.css";
import icon from "../../images/saveIcon.svg"

function MoviesCard({image, onClick, title}) {
    return (
    <div className="movie">
        <img src={image} alt={title} className="movie__image" />
        <div className="movie__like-button_and_caption">
            <p className="movie__like-caption">`{title} || hfp`</p>
            <button className="movie__like-button" type="button">
                <img className="movie__like-button__image" src={icon} onClick={onClick} alt="сердечко" />
            </button>
        </div>
    </div>
    );
  }

  export default MoviesCard;
